import './Rank.scss';
import React from "react";
import ListView from './ListView';

function Rank() {
  return (
    <div className="Rank">
      <h1>Rank Page</h1>
      <span class="row">
        <div class="fact-box"></div>
        fact
        <div class="conv-box"></div>
        conv
        <div class="false-box"></div>
      </span>


      <ListView />
    </div>
  );
}

export default Rank;
